import React from 'react';


class VRModel extends React.Component {
   render() {
      return (
         <div>


    <model-viewer src={process.env.PUBLIC_URL+"Images/scene.gltf"} alt="A 3D model of an astronaut" ></model-viewer>

         </div>
      );
   }
}
export default VRModel;
